import React from 'react';
import { useForm } from 'react-hook-form';
import { MdEmail, MdLock, MdPerson} from 'react-icons/md';
import { useNavigate } from 'react-router-dom';
import { Button } from '../../components/button';
import { Input } from '../../components/input';
import { Container, LoginContainer, Lados} from './styles'

function Login() {
  const { control, formState: { errors }, handleSubmit } = useForm();

  const navigate = useNavigate(); 

  const onSubmit = (data: any) => {
    console.log(data); // Processar dados do formulário
    navigate('/dashboard'); // Redireciona para o dashboard após login
  };

  return (

    <Container>

      <Lados>
        <LoginContainer >
          <h1>Entrar</h1>
          <p>Faça login para acessar nosso sistema.</p>

          <form onSubmit={handleSubmit(onSubmit)}>
            <Input 
                name="email" 
                control={control} 
                placeholder="Email" 
                leftIcon={<MdEmail />} 
                isRequired={true} 
            />
            <Input 
                name="password" 
                control={control} 
                placeholder="Senha" 
                leftIcon={<MdLock />} 
                isRequired={true} 
                type="password"
            />
            <Button titulo="Entrar" type="submit" variant='primario' />
          </form>
          <hr />
          <Button titulo="Entrar" type="submit" variant='secundario' />
          <Button titulo="Entrar" type="submit" variant='secundario' />
          <Button titulo="Entrar" type="submit" variant='secundario' />
      </LoginContainer>

      </Lados>


      <Lados>
        teste
      </Lados>
    </Container>


  );
}

export {Login};
